import React from "react";
import "./App.css";
import MainNavber from "./Component/navbar";
import MyCard from "./Component/card";
import AddNumber from "./Component/addNumber";



function App() {
  const listItems = numbers.map(number => <MyCard title={number} />);
  return (
    <div className="App">
      <MainNavber />
      <AddNumber />
      {listItems}
    </div>
  );
}

export default App;
